//draw the box 
void draw_box(int xidx,int yidx, short int color, int size){
	int i, j;
	for(i = xidx; i<(xidx+ size);i++){ // need to check in the pixel space
		for(j = yidx; j<(yidx+ size);j++){
		 	plot_pixel(i, j, color);
		}
	}
}

